<template>
  <text class="roboto-font">{{ text }}</text>
</template>

<script>
export default {
  name: 'CustomMonoFont',
  props: {
    text: {
      type: String,
      required: true,
    },
  },
  // #ifdef APP-NVUE
  beforeCreate() {
    /**
     * iconfont 需要用ttf转base64
     * 转换网址：https://www.giftofspeed.com/base64-encoder/
     */
    const dom = uni.requireNativePlugin('dom')
    dom.addRule('fontFace', {
      fontFamily: 'Roboto',
      src:
        "url('data:font/truetype;charset=utf-8;base64,')",
    })
  },
  // #endif
}
</script>

<style scoped>
/* #ifndef APP-NVUE */
@font-face {
  font-family: 'robotoregular';
  src: url('./Roboto-Regular-webfont.woff') format('woff');
}

/* #endif */
.roboto-font {
  font-family: Roboto;
}
</style>
